contract DogeoneNFT is ERC721Enumerable, Ownable {
    using Counters for Counters.Counter;
    using Strings for uint256;

    address payable private _DevAddress;

    uint256 public constant MAX_NFT = 4445; //MAX SUPPLY IS 4444 - VALIDATION < 4445 = 4444 
    uint256 public PURCHASE_LIMIT = 20;
    uint private price = 250_000_000_000_000_000;

    bool private _isActive = true;
    string private baseExtension = ".json";
    string private _contractURI = "";
    string private _tokenBaseURI1 = "";
    string private _tokenBaseURI2 = "";
    string private _tokenBaseURI3 = "";
    string private _tokenBaseURI4 = "";
    string private _tokenBaseURI5 = "";
    string private _tokenBaseURI6 = "";
    string private _tokenBaseURI7 = "";

    Counters.Counter private _DogeoneCounter;

    constructor() ERC721("Dogeone NFT", "Dogeone NFT") {
        _DogeoneCounter.increment(); //INCREMENT THE BLOCK COUNTER TO 1 BECAUSE OUR NFT BLOCK START FROM 1 / TOKEN 1 
        _DevAddress = payable(msg.sender);
    }

    function PRICE() public view returns(uint256){
        return price;
    }

    function setPrice(uint256 newPrice) external onlyOwner{
        price = newPrice;
    }

    function setActive(bool isActive) external onlyOwner {
        _isActive = isActive;
    }

    function setContractURI(string memory URI) external onlyOwner {
        _contractURI = URI;
    }

    function setBaseURI(
        string memory URI1,
        string memory URI2,
        string memory URI3,
        string memory URI4,
        string memory URI5,
        string memory URI6,
        string memory URI7
    ) external onlyOwner {
        if (bytes(URI1).length != 0) _tokenBaseURI1 = URI1;
        if (bytes(URI2).length != 0) _tokenBaseURI2 = URI2;
        if (bytes(URI3).length != 0) _tokenBaseURI3 = URI3;
        if (bytes(URI4).length != 0) _tokenBaseURI4 = URI4;
        if (bytes(URI5).length != 0) _tokenBaseURI5 = URI5;
        if (bytes(URI6).length != 0) _tokenBaseURI6 = URI6;
        if (bytes(URI7).length != 0) _tokenBaseURI7 = URI7;
    }

    function setPurchaseLimit(uint256 purchaseLimit) external onlyOwner {
        PURCHASE_LIMIT = purchaseLimit;
    }

    function gift(address to, uint256 numberOfTokens) external onlyOwner {
        for (uint256 i = 0; i < numberOfTokens; i++) {
            uint256 tokenId = _DogeoneCounter.current();

            if (_DogeoneCounter.current() < MAX_NFT) {
                _DogeoneCounter.increment();
                _safeMint(to, tokenId);
            }
        }
    }

    function purchase(uint256 numberOfTokens) external payable {
        require(_isActive, "Contract is not active");
        require(
            numberOfTokens <= PURCHASE_LIMIT,
            "Can only mint up to purchase limit"
        );
        require(
            _DogeoneCounter.current() < MAX_NFT,
            "Purchase would exceed MAX_NFT"
        );
        require(
            PRICE() * numberOfTokens <= msg.value,
            "Payment amount is not sufficient"
        );

        for (uint256 i = 0; i < numberOfTokens; i++) {
            uint256 tokenId = _DogeoneCounter.current();

            if (_DogeoneCounter.current() < MAX_NFT) {
                _DogeoneCounter.increment();
                _safeMint(msg.sender, tokenId);
            }
        }

        _DevAddress.transfer(msg.value);
    }

    function contractURI() public view returns (string memory) {
        return _contractURI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721)
        returns (string memory)
    {
        require(_exists(tokenId), "Token does not exist");

        if (tokenId > 0 && tokenId < 651) {
            return string(abi.encodePacked(_tokenBaseURI1, tokenId.toString(), baseExtension));
        } else if (tokenId >= 651 && tokenId < 1301) {
            return string(abi.encodePacked(_tokenBaseURI2, tokenId.toString(), baseExtension));
        } else if (tokenId >= 1301 && tokenId < 1951) {
            return string(abi.encodePacked(_tokenBaseURI3, tokenId.toString(), baseExtension));
        } else if (tokenId >= 1951 && tokenId < 2601) {
            return string(abi.encodePacked(_tokenBaseURI4, tokenId.toString(), baseExtension));
        } else if (tokenId >= 2601 && tokenId < 3251) {
            return string(abi.encodePacked(_tokenBaseURI5, tokenId.toString(), baseExtension));
        } else if (tokenId >= 3251 && tokenId < 3901) {
            return string(abi.encodePacked(_tokenBaseURI6, tokenId.toString(), baseExtension));
        } else if (tokenId >= 3901 && tokenId < 4445) {
            return string(abi.encodePacked(_tokenBaseURI7, tokenId.toString(), baseExtension));
        } 
        return "";
    }

    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(msg.sender).transfer(balance);
    }
}
